import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


//Setup Vars
const firstBook = {
    img: 'https://www.slashfilm.com/wp/wp-content/images/terminator-6-direction.jpg',
    title: 'Terminator',
    author: 'James Cameron'
}
const secondBook = {
    img: 'https://www.slashfilm.com/wp/wp-content/images/terminator-6-direction.jpg',
    title: 'James Brown',
    author: 'Mad Dog'
}

function BookList() {
    return (
        <>
            <section className='books'>
                <Book
                    img={firstBook.img}
                    title={firstBook.title}
                    author={firstBook.author}
                >
                    <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Tenetur, maiores.</p>
                </Book>
                <Book
                    img={secondBook.img}
                    title={secondBook.title}
                    author={secondBook.author}
                />
            </section>
        </>
    )
}



const Book = (props, { children }) => {
    return (
        <article>
            <img src={props.img} alt='' />
            <h1>{props.title}</h1>
            <h1> {props.author}</h1>
            {children}
        </article>

    )
}


ReactDOM.render(
    <>
        <BookList />

    </>

    ,
    document.getElementById('root')
)
